                <div className='Music-Info'>
                    <p className='Music-Title'>#012</p>
                    <p className='Music-Content'>MuteHoon</p>
                </div>
                <div className='Button'>

                </div>
                <div className='Progress-Bar'>

                </div>
                <div className='Progress'>
                    03:45
                </div>
            </div>
        </div>
    );
}

export default MusicBottomBar;
